import React from 'react';
import {
  Checkbox,
  FormControl,
  FormControlLabel,
  FormGroup,
  FormLabel,
} from '@mui/material';
import { Box } from '@mui/joy';
import InputLabel from '@mui/material/InputLabel';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';

const optionsCat = [
  { id: '1', label: 'Литые елки' },
  { id: '2', label: 'Уличные елки' },
  { id: '3', label: 'Елки с лампочками' },
  { id: '4', label: 'Заснежные елки' },
  { id: '5', label: 'Комбинированные елки' },
  { id: '6', label: 'Настольные елки' },
];

const optionsHeigth = [
  { id: '1', label: '100 см' },
  { id: '2', label: '110 см' },
  { id: '3', label: '110 см' },
  { id: '4', label: '110 см' },
  { id: '5', label: '110 см' },
  { id: '6', label: '110 см' },
  { id: '7', label: '110 см' },
  { id: '8', label: '110 см' },
  { id: '9', label: '110 см' },
  { id: '10', label: '110 см' },
  { id: '11', label: '110 см' },
];

const optionsRadius = [
  { id: '1', label: '50 см' },
  { id: '2', label: '50 см' },
  { id: '3', label: '50 см' },
  { id: '4', label: '50 см' },
  { id: '5', label: '50 см' },
  { id: '6', label: '50 см' },
];

export default function FormControlLabelPosition() {
  const [heigth, setHeigth] = React.useState('');
  const [radius, setRad] = React.useState('Крепления');

  const handleChangeRad = (event) => {
    setRad(event.target.value);
  };
  const handleChangeHeigth = (event) => {
    setHeigth(event.target.value);
  };
  return (
    <Box display={'flex'} flexDirection={'column'} gap={'10px'}>
      <FormControl component='fieldset'>
        <FormLabel component='legend'>Категории</FormLabel>
        <FormGroup aria-label='position' column='true'>
          {optionsCat.map(({ id, label }) => (
            <FormControlLabel
              key={id}
              value={id}
              control={
                <Checkbox
                  size='small'
                  style={{ marginLeft: '10px', padding: '3px' }}
                />
              }
              label={label}
              labelPlacement='end'
            />
          ))}
        </FormGroup>
      </FormControl>
      <FormControl sx={{ m: 1, minWidth: 120 }} size='small'>
        <InputLabel id='demo-select-small-label'>Высота</InputLabel>
        <Select
          labelId='demo-select-small-label'
          id='demo-select-small'
          value={heigth}
          label='Age'
          onChange={handleChangeHeigth}
          sx={{ width: '150px' }}
        >
          {optionsHeigth.map(({ id, label }) => (
            <MenuItem key={id} value={id}>
              {label}
            </MenuItem>
          ))}
        </Select>
      </FormControl>
      <FormControl sx={{ m: 1, minWidth: 120 }} size='small'>
        <InputLabel id='demo-select-small-label'>Диаметр</InputLabel>
        <Select
          labelId='demo-select-small-label'
          id='demo-select-small'
          value={radius}
          label='Age'
          onChange={handleChangeRad}
          sx={{ width: '150px' }}
        >
          {optionsRadius.map(({ id, label }) => (
            <MenuItem key={id} value={id}>
              {label}
            </MenuItem>
          ))}
        </Select>
      </FormControl>
      <FormControl>
      <FormLabel id="demo-controlled-radio-buttons-group">Gender</FormLabel>
      <RadioGroup
        aria-labelledby="demo-controlled-radio-buttons-group"
        name="controlled-radio-buttons-group"
        value={value}
        onChange={handleChange}
      >
        <FormControlLabel value="female" control={<Radio />} label="Female" />
        <FormControlLabel value="male" control={<Radio />} label="Male" />
      </RadioGroup>
    </FormControl>
    </Box>
  );
}
